function MonthArrow(props) {
    const { year, month, number } = props.day;
  
    // Calculate the new month value and handle the edge case for January
    const newMonth = month === 0 ? 11 : month + 1;
    const newYear = month === 0 ? year + 1 : year;
  
    const newDate = new Date(newYear, newMonth, number);
  
    return (
      <div onClick={() => props.changeCurrentDay(newDate)}>
        <p>&lt;</p>
      </div>
    );
  }
  
  export default MonthArrow;
